import React from 'react';
import { Box, Center, Container, Text } from "@chakra-ui/react";

const Homepage = () => {
  return(
    <Container maxW="xl" centerContent>
      <Box
      d='flex'
      justifyContent='center'
      p={3}
      bg={"white"}
      w="100%"
      m="40px 0 15px 0"
      borderRadius='1g'
      borderWidth="1px"
      textAlign='Center'
      fontSize='4x'
      
      >
        <Text>Dosthi-Chat</Text>
      </Box>
      </Container>
  )
};

export default Homepage;
